INSERT INTO `delito` VALUES (1,'Genocidio','Art. 79',' La persona que, de manera sistemática y generalizada y con la intención de destruir total o parcialmente a un grupo nacional, étnico, religioso o político, realice cualquiera de los siguientes actos, será sancionada con pena privativa de libertad de veintiséis a treinta años: 1. Matanza de miembros del grupo. 2. Lesión grave a la integridad física o mental de miembros del grupo. 3. Sometimiento intencional a condiciones de existencia que acarreen su destrucción física total o parcial. 4. Adopción de medidas forzosas destinadas a impedir nacimientos en el seno del grupo. 5. Traslado forzado de niñas, niños o adolescentes, de un grupo a otro.','26-30 años','Activo'),(2,'Etnocidio','Art. 80',' La persona que, de manera deliberada, generalizada o sistemática, destruya total o parcialmente la identidad cultural de pueblos en aislamiento voluntario, será sancionada con pena privativa de libertad de dieciséis a diecinueve años. ','16-19 años','Activo'),(3,'Exterminio','Art. 81',' La persona que, como parte de un ataque generalizado o sistemático, imponga condiciones de vida que afecten la supervivencia, incluida la privación de alimentos, medicinas u otros bienes considerados indispensables, encaminados a la destrucción de una población civil o una parte de ella, será sancionada con pena privativa de libertad de veintiséis a treinta años','26-30 años','Activo'),(4,'Esclavitud','Art. 82',' -La persona que ejerza todos o algunos atributos del derecho de propiedad sobre otra, constituyendo esclavitud, será sancionada con pena privativa de libertad de veintidós a veintiséis años. ','22-26 años','Activo'),(5,'Persecución','Art. 86',' La persona que, como parte de un ataque generalizado o sistemático, prive de derechos a un grupo o colectividad, fundada en razones de la identidad del grupo o de la colectividad, será sancionada con pena privativa de libertad de veintiséis a treinta años','26-30 años','Activo'),(6,'Agresión','Art. 88',' La persona, independientemente de la existencia o no de declaración de guerra, que estando en condiciones de controlar o dirigir efectivamente la acción política o militar de un Estado, ordene o participe activamente en la planificación, preparación, iniciación o realización de un acto de agresión o ataque armado contra la integridad territorial o la independencia política del Estado ecuatoriano u otro Estado, fuera de los casos previstos en la Carta de la Organización de las Naciones Unidas, será sancionada con pena privativa de libertad de veintiséis a treinta años.','26-30 años','Activo'),(7,'Delitos de lesa humanidad','Art. 89',' Son delitos de lesa humanidad aquellos que se cometan como parte de un ataque generalizado o sistemático contra una población civil por parte del Estado o una organización política o con su autorización, apoyo o aquiescencia: la ejecución extrajudicial; la esclavitud; el desplazamiento forzado de la población que no tenga por objeto proteger sus derechos; la privación ilegal o arbitraria de libertad; la tortura, violación sexual y prostitución forzada; inseminación no consentida, esterilización forzada; y la desaparición forzada, serán sancionados con pena privativa de libertad de veintiséis a treinta años. ','26-30 años','Activo'),(8,'Violación','Art. 171',' Es violación el acceso carnal, con introducción total o parcial del miembro viril, por vía oral, anal o vaginal; o la introducción, por vía vaginal o anal, de objetos, dedos u órganos distintos al miembro viril, a una persona de cualquier sexo. Quien la comete, será sancionado con pena privativa de libertad de diecinueve a veintidós años en cualquiera de los siguientes casos: 1. Cuando la víctima se halle privada de la razón o del sentido, o cuando por enfermedad o por discapacidad no pudiera resistirse. 2. Cuando se use violencia, amenaza o intimidación. 3. Cuando la víctima sea menor de catorce años. Se sancionará con el máximo de la pena prevista en el primer inciso, cuando: 1. La víctima, como consecuencia de la infracción, sufre una lesión física o daño psicológico permanente. 2. La víctima, como consecuencia de la infracción, contrae una enfermedad grave o mortal. 3. La víctima es menor de diez años. 4. La o el agresor es tutora o tutor, representante legal, curadora o curador o cualquier persona del entorno íntimo de la familia o del entorno de la víctima, ministro de culto o profesional de la educación o de la salud o cualquier persona que tenga el deber de custodia sobre la víctima. 5. La víctima se encuentre bajo el cuidado de la o el agresor por cualquier motivo, siempre y cuando no constituya violación incestuosa. En todos los casos, si se produce la muerte de la víctima se sancionará con pena privativa de libertad de veintidós a veintiséis años.','22-26 años','Activo'),(9,'Peculado','Art. 278','Las o los servidores públicos y las personas que actúen en virtud de una potestad estatal en alguna de las instituciones del Estado, determinadas en la Constitución de la República, en beneficio propio o de terceros; abusen, se apropien, distraigan o dispongan arbitrariamente de bienes muebles o inmuebles, dineros públicos o privados, efectos que los representen, piezas, títulos o documentos que estén en su poder en virtud o razón de su cargo, serán sancionados con pena privativa de libertad de diez a trece años.','10-13 años','Activo'),(10,'Enriquecimiento ilícito','Art. 279','Las o los servidores públicos y las personas que actúen en virtud de una potestad estatal en alguna de las instituciones del Estado, determinadas en la Constitución de la República, que hayan obtenido para sí o para terceros un incremento patrimonial injustificado a su nombre o mediante persona interpuesta, producto de su cargo o función, superior a cuatrocientos salarios básicos unificados del trabajador en general, serán sancionados con pena privativa de libertad de siete a diez años.','7-10 años','Activo'),(11,'Cohecho','Art. 280','Las o los servidores públicos y las personas que actúen en virtud de una potestad estatal en alguna de las instituciones del Estado, enumeradas en la Constitución de la República, que reciban o acepten, por sí o por interpuesta persona, beneficio económico indebido o de otra clase para sí o un tercero, sea para hacer, omitir, agilitar, retardar o condicionar cuestiones relativas a sus funciones, serán sancionados con pena privativa de libertad de uno a tres años.','1-3 años','Activo'),(12,'Concusión','Art. 281','Las o los servidores públicos y las personas que actúen en virtud de una potestad estatal en alguna de las instituciones del Estado, determinadas en la Constitución de la República, sus agentes o dependientes oficiales que abusando de su cargo o funciones, por sí o por medio de terceros, ordenen o exijan la entrega de derechos, cuotas, contribuciones, rentas, intereses, sueldos o gratificaciones no debidas, serán sancionados con pena privativa de libertad de tres a cinco años.','3-5 años','Activo'),(13,'Incumplimiento de decisiones legítimas de autoridad competente','Art. 282','La persona que incumpla órdenes, prohibiciones específicas o legalmente debidas, dirigidas a ella por autoridad competente en el marco de sus facultades legales, será sancionada con pena privativa de libertad de uno a tres años','1-3 años','Activo'),(14,'Ataque o resistencia','Art. 283','La persona que ataque o se resista con violencias o amenazas a los empleados públicos, a los depositarios o agentes de la fuerza pública, a los comisionados para la percepción de los impuestos y contribuciones, a los ejecutores de los decretos y fallos judiciales, a los guardas de las aduanas y oficinas de recaudación, a los agentes de policía, de seguridad penitenciaria y a las y los servidores de las entidades complementarias de seguridad de los gobiernos autónomos descentralizados municipales y metropolitanos, cuando obran en ejecución de las leyes, o de las órdenes o reglamentos de la autoridad pública, serán sancionadas con pena privativa de libertad de seis meses a dos años.','6 meses a 2 años','Activo'),(15,'Ruptura de sellos','Art. 284','-La persona que rompa o retire los sellos impuestos por la autoridad competente, para incumplir la medida impuesta, será sancionada con pena privativa de libertad de uno a tres años. ','1-3 años','Activo'),(16,'Tráfico de influencias','Art. 285','Las o los servidores públicos, y las personas que actúen en virtud de una potestad estatal en alguna de las instituciones del Estado, enumeradas en la Constitución de la República, prevaliéndose de las facultades de su cargo o de cualquier otra situación derivada de su relación personal o jerárquica, ejerza influencia en otra u otro servidor para obtener un acto o resolución favorable a sus intereses o de terceros, serán sancionados con pena privativa de libertad de tres a cinco años.','3-5 años','Activo'),(17,'Oferta de realizar tráfico de influencias','Art. 286',' La persona que, ofreciéndose a realizar la conducta descrita en el artículo anterior, solicite de terceros: dádivas, presentes o cualquier otra remuneración o acepte ofrecimiento o promesa, será sancionada con pena privativa de libertad de tres a cinco años.','3-5 años','Activo'),(18,'Usurpación y simulación de funciones públicas','Art. 287',' La persona que ejerza funciones públicas sin autorización o simule cargo o función pública, será sancionada con pena privativa de libertad de uno a tres años.','1-3 años','Activo'),(19,'Uso de fuerza pública contra órdenes de autoridad ','Art. 288',' -Las o los servidores públicos y las personas que actúen en virtud de una potestad estatal en alguna de las instituciones del Estado, enumeradas en la Constitución, que utilice a miembros de la Policía Nacional o Fuerzas Armadas contradiciendo la Constitución, impidiendo la ejecución de órdenes legítimas expedidas por autoridad competente o permitiendo el uso de la violencia sin legitimación legal suficiente, serán sancionados con pena privativa de libertad de uno a tres años.','1-3 años','Activo'),(20,'Testaferrismo','Art. 289',' La persona que consienta en aparentar como suyos bienes muebles, inmuebles, títulos, acciones, participaciones, dinero, valores o efectos que lo representen, producto del enriquecimiento ilícito de la o el servidor o ex servidor público o producto del enriquecimiento privado no justificado, será sancionada con pena privativa de libertad de tres a cinco años.','3-5 años','Activo'),(21,'Delitos contra los bienes institucionales de Fuerzas Armadas o Policía Nacional','Art. 290',' -La o el servidor de las Fuerzas Armadas o Policía Nacional, será sancionado con pena privativa de libertad: 1. Ejecute o no impida, actos que puedan producir incendio, estragos u originar un grave riesgo para la seguridad de una unidad o establecimiento de la Policía Nacional o Fuerzas Armadas. 2. Oculte a sus superiores averías o deterioros graves en instalaciones, aprovisionamiento o material logístico a su cargo que sea de uso del personal policial o militar.','6 meses a 1 años','Activo'),(22,'Elusión de responsabilidades de las o los servidores de las Fuerzas Armadas o Policía Nacional','Art. 291','La o el servidor de las Fuerzas Armadas o Policía Nacional que eluda su responsabilidad en actos de servicio, cuando esta omisión cause daños a una persona, será sancionado con pena privativa de libertad de seis meses a un año.','6 meses a 1 años','Activo'),(23,'Alteración de evidencias y elementos de prueba','Art. 292','La persona o la o el servidor público, que altere o destruya vestigios, evidencias materiales u otros elementos de prueba para la investigación de una infracción, será sancionado con pena privativa de libertad de uno a tres años.','1-3 años','Activo'),(24,' Extralimitación en la ejecución de un acto de servicio','Art. 293','La o el servidor de las Fuerzas Armadas, Policía Nacional o seguridad penitenciaria que se extralimite en la ejecución de un acto del servicio, sin observar el uso progresivo o racional de la fuerza, en los casos que deba utilizarla y que como consecuencia de ello, produzca lesiones a una persona, será sancionado con pena privativa de libertad que corresponda, según las reglas de lesiones, con el incremento de un tercio de la pena. Si como consecuencia de la inobservancia del uso progresivo o racional de la fuerza se produce la muerte de una persona, será sancionado con pena privativa de libertad de diez a trece años.','10-13 años','Activo'),(25,' Abuso de facultades','Art. 294',' La o el servidor de las Fuerzas Armadas o Policía Nacional que, en ejercicio de su autoridad o mando, realice los siguientes actos, será sancionado con pena privativa de libertad de uno a tres años: 1. Imponga contra sus inferiores castigos no establecidos en la Ley o se exceda en su aplicación. 2. Asuma, retenga o prolongue ilegal o indebidamente un mando, servicio, cargo o función militar o policial. 3. Haga requisiciones o imponga contribuciones ilegales. 4. Ordene a sus subalternos el desempeño de funciones inferiores a su grado o empleo; ajenas al interés del servicio o inste a cometer una infracción que ponga en peligro la seguridad de la Policía Nacional o de las Fuerzas Armadas. 5. Obtenga beneficios para sí o terceros, abusando de la jerarquía, grado, función, nivel o prerrogativas, siempre que este hecho no constituya otra infracción. 6. Permita a personas ajenas o desvinculadas a la institución ejercer funciones que les correspondan exclusivamente a los miembros del servicio militar o policial.','1-3 años','Activo'),(26,' Negativa a prestar auxilio solicitado por autoridad civil','Art. 295',' Negativa a prestar auxilio solicitado por autoridad civil','15-30 dias','Activo'),(27,' Usurpación de uniformes e insignias','Art. 296',' La persona que públicamente utilice uniformes o insignias de un cargo oficial que no le corresponden, será sancionada con pena privativa de libertad de quince a treinta días.','15-30 dias','Activo'),(28,' Enriquecimiento privado no justificado','Art. 297',' La persona que obtenga para sí o para otra, en forma directa o por interpuesta persona, incremento patrimonial no justificado mayor a doscientos salarios básicos unificados del trabajador en general, será sancionada con pena privativa de libertad de tres a cinco años. ','3-5 años','Activo');
