DROP TABLE IF EXISTS `proceso`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `proceso` (
  `idproceso` int NOT NULL AUTO_INCREMENT,
  `instancia` int DEFAULT NULL,
  `fechaInicio` date DEFAULT NULL,
  `fechaFinal` date DEFAULT NULL,
  `nroAudiencia` int DEFAULT NULL,
  `documento` longblob,
  `nombreDocumento` varchar(200) DEFAULT NULL,
  `estadoVictimario` varchar(45) DEFAULT NULL,
  `estadoDemanda` varchar(45) DEFAULT NULL,
  `idDelito` int NOT NULL,
  `idPersona` int NOT NULL,
  `idCondena` int NOT NULL,
  `idJuzgado` int NOT NULL,
  `estadoProceso` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`idproceso`),
  KEY `FK_Delito_idx` (`idDelito`),
  KEY `FK_Condena_idx` (`idCondena`),
  KEY `FK_Juzgado_idx` (`idJuzgado`),
  KEY `FK_Persona_idx` (`idPersona`),
  CONSTRAINT `FK_Condena` FOREIGN KEY (`idCondena`) REFERENCES `condena` (`idCondena`),
  CONSTRAINT `FK_Delito` FOREIGN KEY (`idDelito`) REFERENCES `delito` (`iddelito`),
  CONSTRAINT `FK_Juzgado` FOREIGN KEY (`idJuzgado`) REFERENCES `juzgados` (`idjuzgados`),
  CONSTRAINT `FK_Persona` FOREIGN KEY (`idPersona`) REFERENCES `personas` (`idpersona`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
